import React from "react";

import '../Css/Gato.css';

function Gato({ nombre, edad, clase, imagen, arma }){

  const aaa = () => {
    console.log("aaa");
  };

  return(
    <div
    className="contenedor-gato">
      <div
        className="contenedor-ImagenGato">
        <img
          className="imagenGato"
          src={imagen}
          alt="ImagenGato" />
      </div>

      <div
        className="contenedor-DatosTextoGato">
        <label>Nombre: </label>
        <label>Edad: </label>
        <label>Clase: </label>
        <label>Arma: </label>
      </div>
      <div
        className="contenedor-DatosGato">
        <label>{nombre}</label>
        <label>{edad}</label>
        <label>{clase}</label>
        <label>{arma}</label>
      </div>

      <div
        className="contenedor-VidaHabilidadesGato">
        <button
          onClick={aaa}>
            Ver ID
        </button>
      </div>
    </div>
  );
}

export default Gato;
